import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';
import Sidebar from './Sidebar';
import  toast  from 'react-toastify'; // Importing the toast module
import 'react-toastify/dist/ReactToastify.css'; // Import toast CSS

function VehicleList({ vehicles = [] }) {
  const [vehicleData, setVehicleData] = useState(vehicles);
  const [editingVehicle, setEditingVehicle] = useState(null);
  const [formData, setFormData] = useState({
    make: '',
    model: '',
    year: '',
    pricePerDay: '',
    availability: true
  });

  // Track previous vehicles prop value to avoid unnecessary state updates
  const prevVehicles = useRef(vehicles);

  useEffect(() => {
    if (prevVehicles.current !== vehicles) {
      setVehicleData(vehicles);
      prevVehicles.current = vehicles;
    }
  }, [vehicles]);

  // Handle form data change
  const handleInputChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  // Handle form submit for creating or editing a vehicle
  const handleFormSubmit = async (e) => {
    e.preventDefault();

    try {
      if (editingVehicle) {
        // Edit vehicle
        const response = await axios.put(`http://localhost:5000/api/vehicles/${editingVehicle._id}`, formData);
        setVehicleData(vehicleData.map(vehicle => vehicle._id === editingVehicle._id ? { ...vehicle, ...formData } : vehicle));
        setEditingVehicle(null);
        toast.success(`Vehicle updated successfully: ${response.data.message}`); // Show success toast
      } else {
        // Add new vehicle
        const response = await axios.post('http://localhost:5000/api/vehicles', formData);
        console.log('Response data:', response.data); // Log response for debugging
        setVehicleData([...vehicleData, response.data.vehicle]);  // Ensure response contains vehicle
        toast.success(`Vehicle added successfully: ${response.data.message}`); // Show success toast
      }
      setFormData({ make: '', model: '', year: '', pricePerDay: '', availability: true }); // Clear form after submit
    } catch (error) {
      console.error('Error submitting vehicle data:', error);
      toast.error('An error occurred. Please try again.'); // Show error toast
    }
  };

  // Handle Delete
  const handleDelete = async (vehicleId) => {
    try {
      const response = await axios.delete(`http://localhost:5000/api/vehicles/${vehicleId}`);
      setVehicleData(vehicleData.filter(vehicle => vehicle._id !== vehicleId));
      toast.success(`Vehicle deleted successfully: ${response.data.message}`); // Show success toast
    } catch (error) {
      console.error('Error deleting vehicle', error);
      toast.error('Error deleting vehicle. Please try again.'); // Show error toast
    }
  };

  // Handle Edit
  const handleEdit = (vehicle) => {
    console.log('Editing vehicle:', vehicle);  // Debug log
    setEditingVehicle(vehicle);
    setFormData({
      make: vehicle.make,
      model: vehicle.model,
      year: vehicle.year,
      pricePerDay: vehicle.pricePerDay
    });
  };

  return (
    <div className="dashboard-container">
      <Sidebar />
      <div className="main-content">
        <h2>Vehicles</h2>

        {/* Vehicle Form for Add/Edit */}
        <form onSubmit={handleFormSubmit} className="vehicle-form">
          <input
            type="text"
            name="make"
            placeholder="Make"
            value={formData.make}
            onChange={handleInputChange}
            required
          />
          <input
            type="text"
            name="model"
            placeholder="Model"
            value={formData.model}
            onChange={handleInputChange}
            required
          />
          <input
            type="number"
            name="year"
            placeholder="Year"
            value={formData.year}
            onChange={handleInputChange}
            required
          />
          <input
            type="number"
            name="pricePerDay"
            placeholder="Rental Price"
            value={formData.pricePerDay}
            onChange={handleInputChange}
            required
          />
          <button type="submit">{editingVehicle ? 'Update Vehicle' : 'Add Vehicle'}</button>
        </form>

        {/* Table for Vehicles */}
        <div className="table-container">
          <table>
            <thead>
              <tr>
                <th>Make</th>
                <th>Model</th>
                <th>Year</th>
                <th>Rental Price</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {vehicleData.length > 0 ? (
                vehicleData.map((vehicle) => (
                  <tr key={vehicle._id}>
                    <td>{vehicle.make}</td>
                    <td>{vehicle.model}</td>
                    <td>{vehicle.year}</td>
                    <td>{vehicle.pricePerDay}</td>
                    <td>
                      <button onClick={() => handleEdit(vehicle)}>Edit</button>
                      <button onClick={() => handleDelete(vehicle._id)}>Delete</button>
                    </td>
                  </tr>
                ))
              ) : (
                <tr>
                  <td colSpan="5">No vehicles found</td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </div>

      {/* Toast Container for Notifications */}
      <toast.Container />
    </div>
  );
}

export default VehicleList;
